import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the notifications button to open the notifications modal
    await page.waitForSelector('#notificationsBtn', { timeout: 5000 });
    await page.click('#notificationsBtn');

    // Wait for the notifications modal to be visible
    await page.waitForSelector('.notifications-modal', { timeout: 5000 });

    // Extract all notification time elements
    const notificationTimes = await page.$$eval('.notification-time', elements => 
      elements.map(el => el.innerText)
    );

    // Convert time strings to timestamps
    const timestamps = notificationTimes.map(time => {
      const date = new Date();
      const timeParts = time.split(' ');
      if (timeParts[1] === 'hours' || timeParts[1] === 'hour') {
        date.setHours(date.getHours() - parseInt(timeParts[0]));
      } else if (timeParts[1] === 'minutes' || timeParts[1] === 'minute') {
        date.setMinutes(date.getMinutes() - parseInt(timeParts[0]));
      } else if (timeParts[1] === 'seconds' || timeParts[1] === 'second') {
        date.setSeconds(date.getSeconds() - parseInt(timeParts[0]));
      } else if (timeParts.length === 3) {
        // Assuming format is "YYYY-MM-DD HH:MM:SS"
        return new Date(time).getTime(); // Use direct conversion for full date
      }
      return date.getTime();
    });

    // Take a screenshot after extracting data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_extracted.png'));

    return {
      success: true,
      action: "Collected notification time data for analysis",
      extractedData: { timestamps },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
